Bądź zawsze na bieżąco z tym, co dzieje się w Twoim ośrodku największej sieci szkółek piłkarskich dla dzieci w wieku 4-12 lat w naszym kraju, gdziekolwiek jesteś!
Dzięki dedykowanej aplikacji mobilnej Lech Poznań Football Academy:
- sprawdzisz harmonogram treningowy;
- potwierdzisz obecność lub zgłosisz nieobecność dziecka na najbliższym treningu;
- zapoznasz się z naszym kącikiem edukacyjnym;
- otrzymasz powiadomienie wraz z każdym opublikowanym newsem (opcjonalnie);
- zapiszesz dziecko na obóz lub półkolonię;
- zrobisz zakupy w naszym e-sklepie;
- sprawdzisz stan swoich płatności;
- zaktualizujesz swoje dane kontaktowe.
Nie zwlekaj i pobierz naszą dedykowaną aplikację już teraz!

